import { useState } from "react"

export default function KnownIssues() {
    
    const [issueVisibility, setIssueVisibility] = useState("known-issues")
    
    function clickHandler() {
        setIssueVisibility("known-issues-hidden");
    }

    return(
        <>
            <div className={issueVisibility}>
                <button onClick={clickHandler}>X</button>
                <h2>Current known issues</h2>
                <p>Testing</p>
            </div>


        </>
    )
}
